INSERT INTO `oa_survey` VALUES ('2', '219', 'ysyysgshsh', 'sgsgge', 'tsgsh', '1', '1484020187');
INSERT INTO `oa_survey_reply` VALUES ('1', '1', '2', '一盏茶，一缕香，一捧古卷细思量，如豆的灯光下，书香浸染，茶香缭绕，馨香氤氲……犹记得晦涩难懂的《诗经》，在臂弯里浅唱低吟。厚厚的一个精装本，淡蓝灰的封面烫着银白色的字体，古朴的就像一位清清爽爽的秀才，于风中立着，夕阳又照，倦鸟又归。精致的诗行，华丽的感情，高雅的气质，清新的意境，和谐的韵律……“蒹葭苍苍，白露为霜，所谓伊人，在水一方”，水中央的梦中伊人象征了多少人心中爱情的完美境界。对于所爱之人，可望而不可即，几多愁苦，几多思念；“振振君子，归哉归哉”，妻子的呼唤饱含着相思的痛苦，无望的期盼，如何能排解萦绕于心头的忧思？；“死生契阔，与子成说”的誓言在生离死别的现实面前显得如此苍白！古韵古风的诗句里，流淌着美丽永恒的情结和无限的憧憬与寄托。像溯流而上的渊鱼，进入“思无邪”纯美的汪洋之境。书香氤氲，斜靠在软榻上，沉溺于“执子之手，与子偕老”的美好爱情中，憧憬未来……犹记得催人落泪《红楼梦》，在浩瀚书海中一枝独秀。“新仇旧恨知多少”，想起大观园，就会想起她的泪！红楼古道，寄不出千世情，只有木石前的落花，只有孤影的悠悠红尘…花谢花飞花满天，红消香断有谁怜”寥寥数笔，怎能道尽她悲天悯人的哀怨？她会咏叹“人生若只如初见”，恍惚间，仿佛还听见初来贾府时府中传来的声声“林妹妹”，仿佛还看见上一世的木石前盟…几度轮回后，尘垢淡化了前缘，只剩，年华在泛黄的书卷中随暗香散落……书香氤氲，杯中已凉却的清', '1483946057');
INSERT INTO `oa_survey_reply` VALUES ('2', '1', '2', '一盏茶，一缕香，一捧古卷细思量，如豆的灯光下，书香浸染，茶香缭绕，馨香氤氲……犹记得晦涩难懂的《诗经》，在臂弯里浅唱低吟。厚厚的一个精装本，淡蓝灰的封面烫着银白色的字体，古朴的就像一位清清爽爽的秀才，于风中立着，夕阳又照，倦鸟又归。精致的诗行，华丽的感情，高雅的气质，清新的意境，和谐的韵律……“蒹葭苍苍，白露为霜，所谓伊人，在水一方”，水中央的梦中伊人象征了多少人心中爱情的完美境界。对于所爱之人，可望而不可即，几多愁苦，几多思念；“振振君子，归哉归哉”，妻子的呼唤饱含着相思的痛苦，无望的期盼，如何能排解萦绕于心头的忧思？；“死生契阔，与子成说”的誓言在生离死别的现实面前显得如此苍白！古韵古风的诗句里，流淌着美丽永恒的情结和无限的憧憬与寄托。像溯流而上的渊鱼，进入“思无邪”纯美的汪洋之境。书香氤氲，斜靠在软榻上，沉溺于“执子之手，与子偕老”的美好爱情中，憧憬未来……犹记得催人落泪《红楼梦》，在浩瀚书海中一枝独秀。“新仇旧恨知多少”，想起大观园，就会想起她的泪！红楼古道，寄不出千世情，只有木石前的落花，只有孤影的悠悠红尘…花谢花飞花满天，红消香断有谁怜”寥寥数笔，怎能道尽她悲天悯人的哀怨？她会咏叹“人生若只如初见”，恍惚间，仿佛还听见初来贾府时府中传来的声声“林妹妹”，仿佛还看见上一世的木石前盟…几度轮回后，尘垢淡化了前缘，只剩，年华在泛黄的书卷中随暗香散落……书香氤氲，杯中已凉却的清', '1483946142');
