  `h_pwd` varchar(50) DEFAULT '000000' COMMENT '环信密码',
  `allow_task_email` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否接受任务邮件推送 0 不接受 1接受',
  `allow_apply_email` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否接受申请邮件推送 0不接受 1接受',
  `allow_notice_email` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否接受公告邮件推送 0 不接受 1接受',
  `allow_project_email` tinyint(1) NOT NULL DEFAULT '0',
  `allow_approval_email` tinyint(1) NOT NULL DEFAULT '0',
  `allow_meeting_email` tinyint(1) NOT NULL DEFAULT '0',
  `allow_task_app` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否接受app任务消息推送 0不接受 1接受',
  `allow_apply_app` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否接受app申请消息推送 0不接受 1接受',
  `allow_notice_app` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否接受app公告消息推送 0不接受 1接受',
  `allow_project_app` tinyint(1) NOT NULL DEFAULT '1',
  `allow_approval_app` tinyint(1) NOT NULL DEFAULT '1',
  `allow_meeting_app` tinyint(1) NOT NULL DEFAULT '1',
  `perm_groupid` tinyint(1) NOT NULL DEFAULT '3',
  `is_del` tinyint(1) NOT NULL DEFAULT '0',
  `permission` text,
  `leave_points` int(11) NOT NULL DEFAULT '0' COMMENT '等级积分',
  `imei` varchar(255) DEFAULT NULL COMMENT '设备号',
  `employee_no` varchar(20) DEFAULT '' COMMENT '员工编号',
  `is_formal` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0 非正式员工  1正式员工(即转正的员工)',
  `is_first_login` int(1) DEFAULT '1' COMMENT '1为第一次登录',
  `head_img` varchar(20) NOT NULL DEFAULT '' COMMENT '用户头像',
  `rank_level` varchar(100) DEFAULT '' COMMENT '职级',
  `gallery` tinyint(3) unsigned DEFAULT '1' COMMENT '鼠标拖动效果 1显示 2不显示',
  PRIMARY KEY (`u_id`)
) ENGINE=InnoDB AUTO_INCREMENT=587 DEFAULT CHARSET=utf8;

