  `task_id` int(11) NOT NULL AUTO_INCREMENT,
  `task_level` tinyint(1) DEFAULT '3' COMMENT '任务等级 1 高  2 中 3低',
  `task_title` varchar(100) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '任务标题',
  `task_type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1 普通指派任务 2 悬赏任务',
  `task_desc` text CHARACTER SET utf8 COMMENT '任务描述',
  `begin_time` int(11) NOT NULL DEFAULT '0' COMMENT '开始时间',
  `end_time` int(11) NOT NULL DEFAULT '0' COMMENT '结束时间',
  `delay_time` int(11) DEFAULT '0' COMMENT '延期时间',
  `pro_id` int(11) DEFAULT '0' COMMENT '关联项目id',
  `point` int(11) DEFAULT '0' COMMENT '任务积分',
  `creater` int(11) NOT NULL DEFAULT '0' COMMENT '创建人id',
  `charger` int(11) NOT NULL DEFAULT '0' COMMENT '任务负责人id',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0 待发布1 待接受 2 进行中 3 待审核 4 已完成 5 已关闭 6 已拒绝',
  `is_publish` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0 未发布 1 已发布',
  `speed` int(11) DEFAULT '0' COMMENT '完成速度',
  `quality` int(11) DEFAULT '0' COMMENT '完成质量',
  `update_time` int(11) NOT NULL DEFAULT '0',
  `work_note` text CHARACTER SET utf8 COMMENT '工作笔记',
  `reason` text CHARACTER SET utf8 COMMENT '审核不通过原因',
  `is_repoint` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否重新指派',
  PRIMARY KEY (`task_id`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8mb4;

-- ----------------------------
-- Records of oa_task
-- ----------------------------

-- ----------------------------
-- Table structure for oa_task_attachment
-- ----------------------------
DROP TABLE IF EXISTS `oa_task_attachment`;
CREATE TABLE `oa_task_attachment` (
  `task_att_id` int(11) NOT NULL AUTO_INCREMENT,
  `task_id` int(11) NOT NULL DEFAULT '0' COMMENT '任务ID',
  `type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1 创建或编辑任务上传的附件  2 完成时提交的附件',
  `task_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1 普通指派任务 2 悬赏任务',
  `file_name` text NOT NULL COMMENT '文件名',
  `real_name` text NOT NULL COMMENT '文件上传后被重命名后的文件名',
  `file_size` int(11) NOT NULL DEFAULT '0' COMMENT '文件大小',
  `file_path` varchar(100) NOT NULL DEFAULT '' COMMENT '文件存储路径',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '文件上传时间',
  `file_type` varchar(50) NOT NULL COMMENT '文件类型',
  PRIMARY KEY (`task_att_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of oa_task_attachment
-- ----------------------------

-- ----------------------------
-- Table structure for oa_task_log
-- ----------------------------
DROP TABLE IF EXISTS `oa_task_log`;
CREATE TABLE `oa_task_log` (
  `task_log_id` int(11) NOT NULL AUTO_INCREMENT,
  `task_id` int(11) NOT NULL DEFAULT '0' COMMENT '任务ID',
  `task_type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1 普通指派任务 2 悬赏任务',
  `u_id` int(11) NOT NULL DEFAULT '0' COMMENT '操作人ID',
  `content` text CHARACTER SET utf8 NOT NULL COMMENT '日志内容',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`task_log_id`)
) ENGINE=InnoDB AUTO_INCREMENT=91 DEFAULT CHARSET=utf8mb4;

-- ----------------------------
-- Records of oa_task_log
-- ----------------------------

-- ----------------------------
-- Table structure for oa_task_member
-- ----------------------------
DROP TABLE IF EXISTS `oa_task_member`;
CREATE TABLE `oa_task_member` (
  `task_mem_id` int(11) NOT NULL AUTO_INCREMENT,
  `task_id` int(11) NOT NULL DEFAULT '0' COMMENT '悬赏任务ID',
  `u_id` int(11) NOT NULL DEFAULT '0' COMMENT '任务认领人ID',
  `is_charge` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否是悬赏任务负责人  0 否  1 是',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '认领时间',
  PRIMARY KEY (`task_mem_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of oa_task_member
-- ----------------------------

-- ----------------------------
-- Table structure for oa_task_msg
-- ----------------------------
DROP TABLE IF EXISTS `oa_task_msg`;
CREATE TABLE `oa_task_msg` (
  `msg_id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL DEFAULT '0' COMMENT '消息接收人ID',
  `operator` int(11) NOT NULL DEFAULT '0' COMMENT '操作人ID',
  `task_id` int(11) DEFAULT '0' COMMENT '关联任务ID',
  `title` varchar(1000) NOT NULL DEFAULT '' COMMENT '消息标题',
  `task_title` varchar(1000) NOT NULL DEFAULT '' COMMENT '任务标题',
  `is_read` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已读 0未读 1已读',
  `newest` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0 不是最新  1 最新',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `menu` tinyint(4) NOT NULL COMMENT '（详情后退跳转的地址）1、我接受的任务 2、我发布的任务 3、悬赏专区 4、我的悬赏',
  `task_type` tinyint(4) DEFAULT '0' COMMENT '任务类型 1：指派任务 2：悬赏任务',
  PRIMARY KEY (`msg_id`)
) ENGINE=MyISAM AUTO_INCREMENT=52 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of oa_task_msg
-- ----------------------------

-- ----------------------------
-- Table structure for oa_task_range
-- ----------------------------
DROP TABLE IF EXISTS `oa_task_range`;
CREATE TABLE `oa_task_range` (
  `task_org_id` int(11) NOT NULL AUTO_INCREMENT,
  `task_id` int(11) NOT NULL DEFAULT '0' COMMENT '悬赏任务ID',
  `org_id` int(11) NOT NULL DEFAULT '0' COMMENT '悬赏组ID',
  PRIMARY KEY (`task_org_id`)
) ENGINE=InnoDB AUTO_INCREMENT=98 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of oa_task_range
-- ----------------------------

-- ----------------------------
-- Table structure for oa_task_skill
-- ----------------------------
DROP TABLE IF EXISTS `oa_task_skill`;
CREATE TABLE `oa_task_skill` (
  `task_skill_id` int(11) NOT NULL AUTO_INCREMENT,
  `task_id` int(11) NOT NULL COMMENT '任务ID',
  `task_type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1 普通任务,oa_task表的数据 2 悬赏任务，oa_reward_task表的数据',
  `skill_id` int(11) NOT NULL DEFAULT '0' COMMENT '技能ID',
  PRIMARY KEY (`task_skill_id`)
) ENGINE=InnoDB AUTO_INCREMENT=60 DEFAULT CHARSET=utf8;

