-- Records of oa_task_skill
-- ----------------------------

-- ----------------------------
-- Table structure for oa_vacation_inventory
-- ----------------------------
DROP TABLE IF EXISTS `oa_vacation_inventory`;
CREATE TABLE `oa_vacation_inventory` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `u_id` int(11) NOT NULL DEFAULT '0' COMMENT '员工ID',
  `expire_time` int(11) NOT NULL DEFAULT '0' COMMENT '过期时间',
  `is_valid` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否有效 0 未使用 1 已使用 2 已过期',
  `creat_time` int(11) DEFAULT NULL COMMENT '记录创建时间',
  `over_time` int(11) NOT NULL DEFAULT '0' COMMENT '加班日期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of oa_vacation_inventory
-- ----------------------------

-- ----------------------------
-- Table structure for oa_vacation_log
-- ----------------------------
DROP TABLE IF EXISTS `oa_vacation_log`;
CREATE TABLE `oa_vacation_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `u_id` int(11) DEFAULT NULL COMMENT '员工ID',
  `log_type` tinyint(4) DEFAULT NULL COMMENT '日志类型 1.调休 2.年假 3.带薪病假 4.病假',
  `value_before` decimal(11,1) DEFAULT NULL COMMENT '变更前的值',
  `value_after` decimal(11,1) DEFAULT NULL COMMENT '变更后的值',
  `log_content` varchar(200) DEFAULT NULL COMMENT 'log内容',
  `create_time` int(11) DEFAULT NULL COMMENT '记录创建时间',
  `operator_id` int(11) DEFAULT NULL COMMENT '操作人ID',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of oa_vacation_log
-- ----------------------------

-- ----------------------------
-- Table structure for oa_vacation_set
-- ----------------------------
DROP TABLE IF EXISTS `oa_vacation_set`;
CREATE TABLE `oa_vacation_set` (
  `set_id` int(11) NOT NULL AUTO_INCREMENT,
  `ini_annual_vacation` tinyint(2) NOT NULL DEFAULT '5' COMMENT '初始年假',
  `cal_cycle_start` varchar(10) NOT NULL COMMENT '年假计算周期开始时间',
  `cal_cycle_end` varchar(10) NOT NULL COMMENT '年假计算周期结束时间',
  `vacation_expire` varchar(10) NOT NULL COMMENT '年假延长期限',
  `overtime_expire` mediumint(4) NOT NULL COMMENT '调休假失效时间(单位天)',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  `increase_rules` text NOT NULL COMMENT '工作work_year年后，增加increase_num天年假。json格式,[{''work_year'':2,''increase_num'':1}]',
  PRIMARY KEY (`set_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of oa_vacation_set
-- ----------------------------

-- ----------------------------
-- Table structure for oa_vacation_used
-- ----------------------------
DROP TABLE IF EXISTS `oa_vacation_used`;
CREATE TABLE `oa_vacation_used` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `u_id` int(11) NOT NULL COMMENT '用户ID',
  `used_num` decimal(4,1) NOT NULL COMMENT '休假天数',
  `vacation_type` tinyint(4) NOT NULL COMMENT '休假类型  1年假  2顺延年假   3调休   4带薪病假   5病假  6事假 7哺乳假 8婚假 9产假 10陪产假 11丧产假',
  `start_time` int(11) NOT NULL COMMENT '休假开始时间',
  `end_time` int(11) DEFAULT NULL COMMENT '休假结束时间',
  `create_time` int(11) DEFAULT NULL COMMENT '记录创建时间',
  `apply_id` int(11) DEFAULT NULL COMMENT '请假ID',
  `status` int(1) DEFAULT '1' COMMENT '1通过  -1未通过 -2驳回过期',
  `note` varchar(100) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of oa_vacation_used
-- ----------------------------

-- ----------------------------
-- Table structure for oa_work_item
-- ----------------------------
DROP TABLE IF EXISTS `oa_work_item`;
CREATE TABLE `oa_work_item` (
  `item_id` int(11) NOT NULL AUTO_INCREMENT,
  `work_id` int(11) NOT NULL,
  `task_id` int(11) NOT NULL DEFAULT '0' COMMENT '关联的任务id',
  `type` tinyint(2) NOT NULL DEFAULT '1' COMMENT '1,本日工作项 2,本周的工作项  3,明日工作计划 4，下周的工作计划',
  `content` text CHARACTER SET utf8 NOT NULL COMMENT '工作项',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '1,未完成 2,已完成',
  `create_time` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`item_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4;

-- ----------------------------
-- Records of oa_work_item
-- ----------------------------

-- ----------------------------
-- Table structure for oa_work_remind
-- ----------------------------
DROP TABLE IF EXISTS `oa_work_remind`;
CREATE TABLE `oa_work_remind` (
  `remind_id` int(11) NOT NULL,
  `u_id` int(11) NOT NULL,
  `type` tinyint(11) NOT NULL DEFAULT '1' COMMENT '1,日报填写 2,周报填写',
  `remind_time` tinyint(2) NOT NULL DEFAULT '17' COMMENT '提醒时间',
  `day` tinyint(2) NOT NULL DEFAULT '5' COMMENT '周报每周星期几提醒',
  `is_use` tinyint(2) NOT NULL DEFAULT '1' COMMENT '是否启用 1,启用 0，不启用',
  PRIMARY KEY (`remind_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of oa_work_remind
-- ----------------------------

-- ----------------------------
-- Table structure for oa_work_statement
-- ----------------------------
DROP TABLE IF EXISTS `oa_work_statement`;
CREATE TABLE `oa_work_statement` (
  `work_id` int(11) NOT NULL AUTO_INCREMENT,
  `u_id` int(11) NOT NULL,
  `type` tinyint(2) NOT NULL DEFAULT '1' COMMENT '工作报告类型1，日报 2，周报',
  `cycle` varchar(30) CHARACTER SET utf8 NOT NULL COMMENT '周期',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '状态0,未提交  1,待审阅 2,已审阅',
  `commit_time` int(11) NOT NULL COMMENT '提交时间',
  `approve_time` int(11) NOT NULL COMMENT '审阅时间',
  `approver` int(11) NOT NULL DEFAULT '0' COMMENT '审阅人ID',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '生成时间',
  `work_content` text COMMENT '工作内容',
  `plan_content` text CHARACTER SET utf8 COMMENT '计划工作内容',
  PRIMARY KEY (`work_id`),
  KEY `idx_u_id` (`u_id`),
  KEY `idx_type` (`type`),
  KEY `idx_status` (`status`) USING BTREE,
  KEY `idx_create_time` (`create_time`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1917 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT;

-- ----------------------------
-- Records of oa_work_statement
-- ----------------------------

-- ----------------------------
-- Table structure for oa_workday_set
-- ----------------------------
DROP TABLE IF EXISTS `oa_workday_set`;
CREATE TABLE `oa_workday_set` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `begin_time` varchar(255) NOT NULL DEFAULT '9:00' COMMENT '上班时间',
  `end_time` varchar(255) NOT NULL DEFAULT '18:00' COMMENT '下班时间',
  `workday_time` varchar(255) NOT NULL DEFAULT '19:00' COMMENT '工作日加班起算时间',
  `workday_lose` int(3) NOT NULL DEFAULT '5' COMMENT '工作日加班调休失效时间（天）',
  `unworkday_time` float(2,1) NOT NULL DEFAULT '1.0' COMMENT '非工作日加班休息时间(小时)',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of oa_workday_set
-- ----------------------------

-- ----------------------------
-- Procedure structure for ws
-- ----------------------------
DROP PROCEDURE IF EXISTS `ws`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `ws`()
begin 
declare i INT default 1;
while i <=65536 do
set i = i+1;
end while;
end
;;
DELIMITER ;
